import { setupSubmission, 
    useLazyFetchSubmissionQuery
} from "../store";
import { useDispatch, useSelector } from "react-redux";
import { useEffect } from "react";
import useSelectAlternative from '../Hooks/useSelectAlternative';

function TryLoadUserSubmission(user)
{
    const [fetchSubmission, results] = useLazyFetchSubmissionQuery();
    const dispatch = useDispatch();
    const submission = useSelector(state => state.submissionData);
    const selectAlternative = useSelectAlternative();

    // Filter and dispatch loaded user questions
    useEffect(() => {
        if(user.id == 0) return;
        if(submission.id != 0) return;

        if(results.isUninitialized) 
        {
            fetchSubmission(user);
            return;
        }

        if(results.isFetching ||
            results.isLoading ||
            results.error) return;

        results.answers.map((answer) =>{
            dispatch(selectAlternative(answer.answerId));
        })

        dispatch(setupSubmission(results.data[0]));
        console.log('dispatched submission to slice');
        console.log(results.data[0]);

    });

}

export default TryLoadUserSubmission;
